import React from 'react';

const Footer =()=>{
  return (
    <>
      <footer className="bg-light text-center navbar bg-warning navbar-dark">
        <p>©️ 2020 RijonTech. All Rights Reserved | Terms and Condition</p>
      </footer>
    </>
  );
}
export default Footer;
